export default function Dashboard(){
    const logout = () => {
        //alert("Loggin out ... ");
        sessionStorage.removeItem('userID');
        window.location.href = '/login';
    }
    const handlePanels = () =>{
        alert("Hi!");
    }
    return(
        <div className="d-flex flex-mobile" style={{minHeight:'60vh'}}>
            <div className="side-panel">
                <PanelButton/>
            </div>
            <div className="main-panel">
                <span>
                    
                </span>
            </div>
        </div>
    );
    
    function PanelButton(btnName){
        return(
            <button onClick={handlePanels}>{btnName}</button>
        );
    }
}
